import io from "socket.io-client"
import React, { Component } from "react"

class App2 extends Component {
    componentDidMount() {
        const socket = io("http://localhost:8080")
        console.log(socket)
        socket.on("hi", (message) => {
            console.log(message)
        })
    }
    render() {
        // socket.emit("join", "Happy")
        return <div>Hi</div>
    }
}

export default App2
